func countEnabled(extensions []ExtensionInfo) int {
	count := 0
	for _, ext := range extensions {
		if ext.Enabled {
			count++
		}
	}
	return count
}

func countByCategory(extensions []ExtensionInfo, category string) int {
	count := 0
	for _, ext := range extensions {
		if ext.Category == category {
			count++
		}
	}
	return count
}

